import ContentBox from "../Components/content-b";
import NavigationBar from "../Components/nav";

function HomePage(){

    return (

        <div>
            <h1>Home</h1>
            <NavigationBar/>
            <ContentBox content = "My name is Neil Grover, a second year college student at UCSC pusuing a bachelors in Computer Science. I am looking for internship opportunities for undergraduate students for the summer 2023 time period. I hope to complete my degree with a focus on AI and machine learning and also plan to minor in Applied MAthematics." />
        </div>
    );
}

export default HomePage;
